import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router } from 'react-router-dom';
import App from './App';
import { LanguageProvider } from './LanguageContext'; 

ReactDOM.render(
  <Router>
    <LanguageProvider>
      <App />
    </LanguageProvider>
  </Router>,
  document.getElementById('root')
);
